Review Summary- Control
=====================
SCORE: 9.1
=====================
You looking for a paranormal, sci-fi action game? This is the game for you! I can guarantee you haven't played anything quite like this before.

It has such a unique style and atmosphere, it oozes mystique, and has a certain stillness that keeps you on edge. It's reminiscent of the old Stanley Kubrick classics, so it wouldn't surprise me if that's where they got their inspiration from.

The combat is some of the most fun you'll have this year. Both the gunplay and psychic abilities are polished and each battle is a thrill. You'll always leave the battlefield in a state of choas, thanks to the destructible environments.

The story is full of mystery and will keep you invested, even if it can be a bit confusing at times, especially with the in-game terminology. Extra lore is told through an excessive amount of collectibles, so while there is a lot to learn about this fascinating world, you're constantly stopping to read yet again. It disrupts gameplay and I do wish it was handled more efficiently.

The side missions are just as much of a standout as the main story, with each one containing an interesting and unique storyline, and I always looked forward to each one.

Exploration was one of the weaker elements of the game, as it did get a little frustrating at times getting to where you needed to go. But this was made up by the amount of hidden secrets (and even some good puzzles) scattered around each area.

While it's a relatively short game, I still recommend this to anyone, as it's one of the better games this year.
Plus I managed to score the platinum trophy for it, so that's always a bonus!
